import React from "react";
import ReactDOM from "react-dom";
import Cards from "./Cards";
import Sdata from "./SData";

console.log(Sdata[0].imgsrc);
ReactDOM.render(
    
    <>
    <Cards
    imgsrc={Sdata[0].imgsrc}
    title={Sdata[0].title}
    SName={Sdata[0].SName}
    refrence={Sdata[0].refrence}
    />
    <Cards
    imgsrc={Sdata[1].imgsrc}
    title={Sdata[1].title}
    SName={Sdata[1].SName}
    refrence={Sdata[1].refrence}
    />
    <Cards
    imgsrc={Sdata[2].imgsrc}
    title={Sdata[2].title}
    SName={Sdata[2].SName}
    refrence={Sdata[2].refrence}
    />
    <Cards
    imgsrc={Sdata[3].imgsrc}
    title={Sdata[3].title}
    SName={Sdata[3].SName}
    refrence={Sdata[3].refrence}
    />
    <Cards
    imgsrc={Sdata[4].imgsrc}
    title={Sdata[4].title}
    SName={Sdata[4].SName}
    refrence={Sdata[4].refrence}
    />
    </>
    ,
    document.getElementById("root")
)
